CREATE MATERIALIZED VIEW stream_query AS WITH with_0 AS (WITH with_1 AS (SELECT t_2.col_0 AS col_0, (INT '786') AS col_1, t_2.col_1 AS col_2 FROM m7 AS t_2 WHERE true GROUP BY t_2.col_1, t_2.col_0 HAVING false) SELECT (BIGINT '1') AS col_0 FROM with_1 WHERE true) SELECT CAST(NULL AS STRUCT<a INT, b TIME>) AS col_0, DATE '2022-12-06' AS col_1, (INT '79') AS col_2 FROM with_0;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
CREATE MATERIALIZED VIEW stream_query AS SELECT (BIGINT '493') AS col_0 FROM hop(bid, bid.date_time, INTERVAL '3600', INTERVAL '180000') AS hop_0 GROUP BY hop_0.bidder, hop_0.price HAVING false;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
CREATE MATERIALIZED VIEW stream_query AS SELECT t_1.col_1 AS col_0, t_0.col_0 AS col_1 FROM m0 AS t_0 LEFT JOIN m6 AS t_1 ON t_0.col_0 = t_1.col_0 AND true WHERE false GROUP BY t_0.col_0, t_1.col_1;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
